- input: "TEXT\x1CC00044842\x1C.TEXT\x1C\x1CF3XA\x1CIn an effort to fully comply with
    FEC rules essential to full disclosure of our federal election campaign finances,
    we offer the following clarification for each of the items requested:  No staff
    member spent more than 25% of their time on federal election activity or any activities
    in connection with a Federal election to be reported on line 30B in December 2007.
    \ Schedule H3 was amended to reflect the omission of the breakdown of the transfer
    in from the non-federal account to reflect $28,534.89  in direct fundraising activity.
    \ The voided check in Schedule H4 represents a check voided due to an incorrect
    payment made.  The check was reissued in the correct amount and reported in our
    September 2008 monthly report.  Per standard procedures in place the transfer
    would have been made in the appropriate allocation ratio to the reissued check.
    Schedule H2 was amended to reflect the allocation ratio for the Celebrate PA 07
    Event."
